import Layout from '../components/Layout';

class donate extends Component {
  constructor(props){
    super(props);
    this.state={
      loading : true,
      err : false
    }
  }

  componentWillMount(){

  }

  componentDidMount(){

  }
  componentDidCatch(error, errorInfo){
    this.setState({err : true})
  }

  
  render() {
    return (
      <div>
        <h1>Your donations make a difference</h1>
        <input 
          className="wpedon_paypalbuttonimage" 
          type="image" 
          src={"https://jaschoolsupport.org/wp-content/uploads/2018/02/paypal-credit-card-images1.jpg"} 
          border="0" 
          name="submit" 
          alt="Make your payments with PayPal. It is free, secure, effective." 
          style={{border: 'none'}} />
      </div>
    );
  }
}

export default Layout(donate);
